column17:
The following post uses a distract tactic by discussing a different irrelevant topic:

@EzraFriedlander @ANCA_DC Ah here we are. I always look forward to hearing bs from Ezra Freeloader. Hey how was that dinner you had with Jake the Fake on Aliyev‚Äôs expense

This post brings up a personal dinner between individuals that is not relevant to the topic of international relations or the current situation being discussed about Aliyev's regime. By focusing on this unrelated personal event, the post distracts from the main issue at hand, which is the aggression of the Aliyev regime on Armenian people. This tactic aims to shift the conversation away from the important subject matter and undermine the credibility of one of the individuals mentioned.

column11:
The only post that uses an Engage tactic by bringing up a related but relevant topic is: 
@knj_brasil @secawards I vote #RM for #ArtistaAsiatico at the 2023 #SECAwards Marcos

This post mentions the year 2023 which could potentially spark a conversation or engagement around the future of international relations.
